import React, { useEffect, useState } from "react";
import { Link, useNavigate } from "react-router-dom";
export default function Navbar() {
  const [authToken, setAuthToken] = useState("");
  useEffect(() => {
    setAuthToken(localStorage.getItem("authToken") || "");
  }, []);
  const navigate = useNavigate();
  const handleLogOut = () => {
    localStorage.removeItem("authToken");
    setAuthToken("");
    navigate("/");
  };
  return (
    <div>
      <nav
        className="navbar fixed-top navbar-expand-lg navbar-dark shadow-5-strong"
        id="navbar"
      >
        <div className="container-fluid">
          <Link className="navbar-brand" to="#">
            FoodCart
          </Link>
          <button
            className="navbar-toggler"
            type="button"
            data-bs-toggle="collapse"
            data-bs-target="#navbarSupportedContent"
            aria-controls="navbarSupportedContent"
            aria-expanded="false"
            aria-label="Toggle navigation"
          >
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse w-80 d-flex">
            {authToken.length !== 0 ? (
              <ul className="navbar-nav me-auto mb-2 mb-lg-0">
                <li className="nav-item">
                  <Link className="nav-link active" aria-current="page" to="#">
                    Orders
                  </Link>
                </li>
              </ul>
            ) : (
              ""
            )}
            <div className="d-flex justify-content-end w-100">
            <form className="d-flex" role="search">
              <input
                className="form-control me-2"
                type="search"
                placeholder="Search"
                aria-label="Search"
              />
              <button className="btn btn-outline-light" type="submit">
                Search
              </button>
            </form>
            <form className="d-flex">
              {authToken.length === 0 ? (
                <div>
                  <Link className="btn btn-outline-light" to="/login">
                    Login
                  </Link>
                  <Link className="btn btn-outline-light ms-2" to="/signup">
                    Signup
                  </Link>
                </div>
              ) : (
                <div className="btn btn-outline-light" onClick={handleLogOut}>
                  Logout
                </div>
              )}
            </form>
            </div>
          </div>
        </div>
      </nav>
    </div>
  );
}
